o tamaÃ±o denominada âushebtiâ de carÃ¡cter mÃ¡gico y ritual que acompaÃ±aban el conjunto funerario como sirvientes del difunto en la otra vida. AdemÃ¡s, segÃºn se informa en un comunicado, se ha descubierto otro fragmento de cerÃ¡mica con inscripciones en copto y el fragmento de una estela con inscripciones jeroglÃ­ficas. El director del proyecto, el profesor del Ãrea de Historia Antigua de la UJA, doctorÂ  Alejandro JimÃ©nez Serrano, prevÃ© comenzar los trabajos de excavaciÃ³n en el interior de la tumba durante esta misma semana. AllÃ­ estudiarÃ¡n y documentarÃ¡n los numerosos restos de momias, asÃ­ como los sarcÃ³fagos y las estatuas de grandes dimensiones que fueron destruidas en la antigÃ¼edad. En esta segunda campaÃ±a de trabajo, que se extenderÃ¡ hasta mediados del mes de diciembre, participan un total de trece investigadores procedentes de la propia UJA, CSIC y la Universidad de Granada, dirigidos por el doctor Alejandro JimÃ©nez Serrano. Los objetivos para este aÃ±o se centran en las excavaciones de las tumbas nÂº 33 y 34, datadas en el XII DinastÃ­a (1850 a. C.), y en la conservaciÃ³n de la tumba nÂº 34h de la VI DinastÃ­a (2150 a. C.). AdemÃ¡s, se estÃ¡ tramitando la construcciÃ³n de un nuevo edificio de usos mÃºltiples en la necrÃ³polis. Este proyecto se enmarca en una acciÃ³n de colaboraciÃ³n cientÃ­fica y cultural entre la Universidad de JaÃ©n y el Consejo Supremo de AntigÃ¼edades de Egipto y como novedad, este aÃ±o se puede consultar a diario el avance preliminar de los trabajos en la pÃ¡gina oficial del proyecto (<a href=\"http://www.qubbetelhawa.es/\">http://www.qubbetelhawa.es</a>). El proyecto estÃ¡ financiado por el Ministerio de Cultura, la Universidad de JaÃ©n, Caja Rural de JaÃ©n, la empresa Guillermo GarcÃ­a SL, IGEA y la AsociaciÃ³n EspaÃ±ola de EgiptologÃ­a.</p><p>&nbsp;</p></div>\r<!-- END: WRAPBUTTONS CONTENT --></div><span class=\"article_separator\">&nbsp;</span><script type=\"text/javascript\">\r<!--\rvar jcomments=new JComments(1